import Home from './components/Home';
import Ecommerce from './pages/EcommerceWebsite/components/Ecommerce';
import { Routes, Route } from 'react-router-dom'
import Collections from './pages/EcommerceWebsite/components/Collections';
import NewArrivals from './pages/EcommerceWebsite/components/NewArrivals';
import './App.css'

function App() {
  return (
    <>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        {/* home page for ecommerce website */}
        <Route path='ecommerce' element={<Ecommerce />}></Route>
        <Route path='ecommerce/collections' element={<Collections />}>
          <Route path='new-arrivals' element={<NewArrivals />}></Route>
          <Route path='house-home' element={<NewArrivals />}></Route>
          <Route path='kitchen' element={<NewArrivals />}></Route>
          <Route path='office' element={<NewArrivals />}></Route>
          <Route path='personal-goods' element={<NewArrivals />}></Route>
          </Route>
        <Route path='*' element={<div>Error 404</div>}></Route>
      </Routes>
    </>
  );
}

export default App;
